import React from "react";
import InstagramIcon from "@mui/icons-material/Instagram";
import TwitterIcon from "@mui/icons-material/Twitter";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="socialMedia">
        <InstagramIcon />
        <TwitterIcon />
      </div>
      <p>&copy; 2024</p>
    </footer>
  );
};

export default Footer;
